            if (e.key == 'f') {
                if (is_fullscreen()) {
                    document.exitFullscreen();

                    videoContainer.requestFullscreen();
                }
                e.preventDefault();
                }
                else if (e.key == ' ') {

                            video.volume = 1;
                        }
                    }
                }
